import React, { useContext, useState } from 'react';

import Login from '../Login/Login';
import Card from '../UI/Card/Card';
import classes from './Home.module.css';
import homeImage from '../../assets/formula.jfif';
import Guest from './Guest';

const Home = (props) => {

  return (
    <React.Fragment>
      <div className={classes.background}>
        <img src={homeImage} alt="Formula" className={classes.img} />
      </div>
      <Card className={classes.home}>{props.openLogin && <Login />}
      {!props.openLogin && <Guest />}</Card>
    </React.Fragment>
  );
};

export default Home;
